import React from "react";
import { courses } from "../data";
import CourseCard from "../components/CourseCard";

const Home = () => {
  return (
    <div>
      <h1>دوراتنا</h1>
      <div style={{ display: "flex", gap: "20px" }}>
        {courses.map(course => (
          <CourseCard key={course.id} course={course} />
        ))}
      </div>
    </div>
  );
};

export default Home;
